import React from 'react'
import {ListGroupItem,CustomInput,Button} from 'reactstrap'
let listView=({todo,btnValue})=>{
    return(
        <div>
            <ListGroupItem className='d-flex align-items-center'>
        <CustomInput
        type='checkbox'
        id={todo.id}
        />
            </ListGroupItem>
            <Button>{btnValue}</Button>
        </div>
    )
}
export default listView;
